import Partners from './Partners';
import styled from 'styled-components';
import { mediaQuery } from '../utils/style';

const divStyle = {
  //marginLeft: 400,
  //marginRight: 400,
}

const layoutStyle = {
  //margin: 20,
  padding: 20,
  border: '1px solid #DDD',
  height: 400,
};

const PartnersLayout = props => (
  <div style={divStyle}>
    <div style={layoutStyle}>
      <Partners />
      {props.children}
    </div>
  </div>
);

export default PartnersLayout;
